import React, {useEffect, useState} from 'react';
import './App.css';
import axios from 'axios';


function One() {
  const [ready, isReady] = useState(false)

  useEffect(()=>{
    axios.post('/click', {url: window.location.href}).then(res=>{
      console.log(res)
    })
  }, [])

  if(!ready){
    return null
  }

  else {
    return (
      <div>
        One
      </div>
    );
  }
}

export default One;
